description:
Verenigde Staten / Canada
Actie / Drama
88 minuten

een goeie film

met Dolph Lundgren, Lindsay Maxwell en Stefanie von Pfetten

Icarus lijkt op een doodnormale gescheiden vader, die werkt bij een investeringsbedrijf. Maar hij heeft ook een hele duistere 
kant: hij leidt namelijk een dubbelleven als huurmoordenaar. Wanneer hij probeert aan te geven dat hij wil stoppen, slaat zijn 
opdrachtgever meedogenloos toe. Icarus moet vluchten om zichzelf en zijn gezin te beschermen.
